    public class LetterOCR
    {
        public char Letter { get; set; }
        public LetterOCRPoint[] Points { get; set; }

        public LetterOCR()
        {
            this.Points = new LetterOCRPoint[0];
        }

        public bool ContainsXYPoint(int x, int y)
        {
            return this.Points != null && this.Points.Any(p => p.x == x && p.y == y);
        }

        public void AddXYPoint(int x, int y)
        {
            if (this.Points == null)
            {
                this.Points = new LetterOCRPoint[0];
            }

            List<LetterOCRPoint> ps = new List<LetterOCRPoint>(this.Points);
            ps.Add(new LetterOCRPoint(x, y));
            this.Points = ps.ToArray();
        }

